import React from "react";
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import IconButton from "@material-ui/core/IconButton";
import Typography from "@material-ui/core/Typography";
import { AccessTime, AccountBox, MoreHoriz } from "@material-ui/icons";
import img1 from "./img1.png";
import { Link } from "react-router-dom";
import { Grid } from "@material-ui/core";
import { useDispatch, useSelector } from "react-redux";
import { addBook } from "./store/action";
import BookCard from "./BookCard";

function CustomGrid() {
  const dispatch = useDispatch();
  dispatch(
    addBook({
      name: "HARRY POTTER",
      author: "VIVEK",
    })
  );

  const object = {
    img_src: img1,
    book_name: "HARRY POTTER NEW SEASON",
    author: "VIVEK REDDY S",
    time_left: "15 min to read",
    persons_read: "15.6k read",
  };

  const array = [object, object, object];

  const state = useSelector((state) => state.books);
  console.log(state);

  return (
    <Grid container>
      {array.map((item) => (
        <BookCard book={item} />
      ))}
    </Grid>
  );
}

export default CustomGrid;
